        (1605, '2025-01-15 15:34:47.443660', '2025-01-15 15:34:47.443663', '16년간 근무하던 미술관 큐레이터를 그만두고 사랑하는 가족과 함께 작은 소망과 평생의 꿈을 이루기 위해 제주로 이주해 온 아트하우스 두:드림 주인장입니다.

2년에 걸쳐 완성한 저희 아트하우스 두:드림은 저희 부부의 꿈이자 아이들의 미래입니다. 
하나님을 붙잡고 기적같은 건축을 완성 후 감사의 눈물을 흘릴때가 생각납니다.

아름다운 제주바다와 사랑하는 가족이 옆에 있어 다시한번 힘을 내고 언제나 제곁에서 기적을 행하여 주신 그분 덕분에 분에 넘치는 건축을 완성하고 여러분께 인사드립니다.

제주에서 작은갤러리와 브런치카페, 게스트하우스를 운영하며 우리 가족이 잘지낼 수 있을까 걱정도 앞섰지만 웃음가득한 아이들의 환한 미소와 저만 믿고 이곳 제주 섬까지 따라와 준 아름다운 아내가 있어 걱정은 100년 후 쯤으로 던져버리려 합니다. 

지금은 나무한그루, 돌하나 제손으로 쌓아가며 하나씩 꾸며가고 있는 이곳에 작은 물방울이 바위를 뚫을 때까지 인내와 믿음으로 제 꿈을 펼치고자 합니다.

